import React from 'react';
import VideoItem from './VideoItem';

const VideoList = ({ videos }) => {
   //
   const video = videos.map((video) => {
      return <VideoItem key={video.id.videoId} title={video.snippet.title} />
      //console.log({video});
   });


   return (
      <div>
         {video}
      </div>
   );
}

export default VideoList;
